import React, { useState } from "react";
import { Menu, X } from "lucide-react";

const Navbar = () => {
  const [open, setOpen] = useState(false);

  return (
    <nav className="fixed top-0 w-full bg-white bg-opacity-90 shadow-md backdrop-blur-sm z-50">
      <div className="max-w-6xl mx-auto px-4 flex items-center justify-between h-16">
        <div className="text-xl font-bold text-green-600">PetMap</div>
        <div className="hidden md:flex space-x-6">
          <a href="#" className="text-gray-700 hover:text-green-600 transition">
            Map
          </a>
          <a href="#" className="text-gray-700 hover:text-green-600 transition">
            Resources
          </a>
          <a href="#" className="text-gray-700 hover:text-green-600 transition">
            History
          </a>
        </div>
        <button
          className="md:hidden p-2 rounded hover:bg-gray-100 focus:outline-none"
          onClick={() => setOpen(!open)}
          aria-label="Toggle menu"
        >
          {open ? <X size={24} /> : <Menu size={24} />}
        </button>
      </div>
      {open && (
        <div className="md:hidden bg-white px-4 pb-4 space-y-3">
          <a href="#" className="block text-gray-700 hover:text-green-600 transition">
            Map
          </a>
          <a href="#" className="block text-gray-700 hover:text-green-600 transition">
            Resources
          </a>
          <a href="#" className="block text-gray-700 hover:text-green-600 transition">
            History
          </a>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
